import React, { Fragment,useState,useEffect } from "react";
import Table from 'react-bootstrap/Table';

const StudentCurd = () => {
  const[data,setdata]=useState();
  console.log("set data:",data);
  
  const rows = [
    {
      Id: 1,
      Name: "Swara",
      age: 23,
      Address: "pune",
      Class: "second",
      SkillId: 1,
    },
    {
      Id: 2,
      Name: "Sunita",
      age: 23,
      Address: "pune",
      Class: "second",
      SkillId: 4,
    }
    ,  {
      Id: 3,
      Name: "Mira",
      age: 23,
      Address: "pune",
      Class: "second",
      SkillId: 5,
    }
  ];
  
  console.log("Show table column:",rows);
  useEffect(()=>{
    setdata(rows);
      },[])
  return (
    <Fragment>
     <Table striped bordered hover>
      <thead>
        <tr>
          <th>Name</th>
          <th>age</th>
          <th>Address</th>
          <th>Username</th>
        </tr>
      </thead>
      <tbody>{

        rows&&rows.length>0?
        rows.map((item,index)=>{
          return(
            <>
<tr key={index}>
          <td>{index.Name}</td>
          <td>{index.age}</td>
          <td>{index.Address}</td>
          <td>@{index.Class}</td>
          <td>@{index.SkillId}</td>
        </tr>
        <tr>
          <td>2</td>
          <td>Jacob</td>
          <td>Thornton</td>
          <td>@fat</td>
        </tr>
        <tr>
          <td>3</td>
          <td>Larry the Bird</td>
          <td>@twitter</td>
        </tr>
        </>
        )
        })
       :
       '...Loading'
        }
      </tbody>
    </Table>
    </Fragment>
  );
};

export default StudentCurd;
